import React from "react";
import { useHistory } from "react-router-dom";

export default function Trainer({ user }) {
  // years * 5 / workouts
  const history = useHistory();

  if (!user) history.push("/");

  const object = [];

  for (let i = 0; i < 3; i++) {
    let init_km = (user.trainingYears * 5) / user.workouts;
    let additional_km = init_km * (0.15 * i);

    object.push({
      id: i + 1,
      km: (init_km + additional_km).toFixed(1),
      success: false,
    });

    const buttons = object.map((value, key) => {
      return (
        <button onClick={() => history.push(`/training_page/${value.id}`)}>
          Workout N.O. {value.id} <br /> {value.km} Km
        </button>
      );
    });
    //(user.years * 5) / user.workouts;
  }
  console.log(object);
  return (
    <div>
      <h1>Trainer</h1>
      <br />
      <button> Start</button>
      {buttons}
    </div>
  );
}
